	'abusefilter-autopromote-blocked' => 'ഈ പ്രവൃത്തി സ്വയം ദോഷകരമെന്നു കണ്ടെത്തിയിട്ടുണ്ട്, അതനുവദിക്കാൻ സാധിക്കുകയില്ല.
